import React from "react"



const UserReservations2 = ({ userReservations, rentCarReservations }) => {

    return (

        <div>
            {
                rentCarReservations ?
                    userReservations.map(reservation => {

                        const carReservation = Array.isArray(rentCarReservations) && rentCarReservations.find(el => el.id == rentCarReservations.carReservationId);
                        return (
                            <ReservationInfo reservation={reservation} carReservation={carReservation} />
                        );
                    })
                    :
                    ''
            }

        </div>
    );

}

export default UserReservations2;
